from agent import *from models.products import *X_CATS = ['Gifts']def run(context, session):    session.sessionbreakers = [SessionBreak(max_requests=6000)]    session.queue(Request("https://www.hookedonline.com.au/"), process_catlist, dict())def process_catlist(data, context, session):    cats = data.xpath('//ul[@class="nav navbar-nav"]/li[@class="dropdown dropdown-hover"]/a')    for cat in cats:        name = cat.xpath('text()').string()        url = cat.xpath('@href').string()        if name not in X_CATS:            session.queue(Request(url), process_prodlist, dict(url=url, cat=name))def process_prodlist(data, context, session):    prods = data.xpath('//div[@class="wrapper-thumbnail col-xs-6 col-sm-4 col-lg-3"]/div/div/h3//a')    for prod in prods:        name = prod.xpath('text()').string()        url = prod.xpath('@href').string()        session.queue(Request(url), process_product, dict(context, name=name, url=url))        next_url = data.xpath('//i[@class="fa fa-chevron-right"]/parent::a/@href').string()    if next_url:        session.queue(Request(next_url), process_prodlist, dict(context))def process_product(data, context, session):    product = Product()    product.name = context['name']    product.url = context['url']    product.category = context['cat']    product.manufacturer = data.xpath('//meta[@itemprop="brand"]/@content').string()    product.sku = data.xpath('//meta[@itemprop="sku"]/@content').string()    product.ssid = product.sku    ean = data.xpath('//meta[@itemprop="gtin13"]/@content').string()    if ean:        product.add_property(type='id.ean', value=ean)    revs_count = data.xpath('//span[@itemprop="ratingCount"]//text()').string()    if not revs_count or revs_count == "0":        return        revs = data.xpath('//head/meta[@itemprop="itemReviewed"]/parent::*')    for rev in revs:        review = Review()        review.type = 'user'        review.url = product.url        review.title = rev.xpath('(following-sibling::body//h4)[1]//text()').string()        review.date = rev.xpath('following-sibling::head/meta[@itemprop="datePublished"]/@content').string()        author = rev.xpath('(following-sibling::body//span[@itemprop="author"])[1]//text()').string()        if author:            review.authors.append(Person(name=author, ssid=author))        grade_overall = rev.xpath('following-sibling::head/meta[@itemprop="ratingValue"]/@content').string()        if grade_overall:            review.grades.append(Grade(type='overall', value=float(grade_overall), best=5.0))        excerpt = rev.xpath('(following-sibling::body//span[@itemprop="description"])[1]//text()').string(multiple=True)        if excerpt:            review.add_property(type='excerpt', value=excerpt)            if author:                review.ssid = review.digest()            else:                review.ssid = review.digest(excerpt)                        product.reviews.append(review)            if product.reviews:        session.emit(product)